import React from "react";
import "./App.css";
import Video from "./Video";

function App() {
  return (
    <div className="app">
      <center>
        <div className="app__videos">
          <div style="width: 100%; height: 0px; position: relative; padding-bottom: 177.778%;">
            <iframe
              src="https://streamable.com/e/lr33p1"
              frameborder="0"
              width="100%"
              height="100%"
              allowfullscreen
              style="width: 100%; height: 100%; position: absolute;"
            ></iframe>
          </div>
          {/* pulled from firebase database */}
          <Video
            url="https://streamable.com/e/lr33p1"
            channel="Howieazy"
            description=" Why he gotta trick me like that #fyp #howieazy #comedy #foryou "
            song="Original Sound - Howieazy"
            likes={97223}
            messages={8811}
            shares={3298}
          />
          <Video
            url="https://streamable.com/e/lr33p1"
            channel="Leenhabbal"
            description=" مين متلي ما بيشعر بالوقت عالtiktok? #tiktokarab #arab #middleeastern"
            song="Come and Get Your Love"
            likes={123}
            messages={12121}
            shares={12121}
          />

          <Video
            url="https://streamable.com/e/lr33p1"
            channel="Amal_Tampa"
            description=" Our differences make us closer #fyp #beach #saudiarabia #french #friends #florida #tampa"
            song="Ride It - Regard"
            likes={2019}
            messages={196}
            shares={114}
          />
        </div>
      </center>
    </div>
  );
}

export default App;
